Flourless and reasy with just 4 ingredients!😍

INGREDIENTS
225 g (1 cup) butter;
500 g (3 cups) dark chocolate, chopped;
7 eggs;
200 g (1 cup) sugar;
METHOD
Melt butter and chocolate together. Leave to cool down slightly.
Meanwhile beat sugar, egg, and vanilla until triple in size (pale and foamy).
Whisk melted chocolate in and pour into the cake pan.
Place the cake pan into a pan filled with hot water.
Bake for 1 hour at 160C/320F. Leave to chill in the fridge overnight before slicing.

